from typing import List

class Solution:
    def maximalSquare(self, matrix: List[List[str]]) -> int:
        i = len(matrix)
        j = len(matrix[0])
        maxS = 0
        # print("Matrix: %d * %d" % (i,j))
        for x in range(i):
            # print()
            for y in range(j):
                tmpS = self.maximalSquareFromPoint(matrix, x, y)
                # print("%s(%s)\t" % (matrix[x][y], tmpS), end='')
                if tmpS > maxS:
                    maxS = tmpS
        return maxS

    def maximalSquareFromPoint(self, matrix, i, j):
        counter = 0
        maxS = 0
        exiter = False
        while (i + counter < len(matrix)) and (j + counter < len(matrix[0])) :
            # rng = range(i , i + counter + 1, 1)
            # print(rng)
            mark = True
            for x in range(i, i + counter +1):
                if matrix[x][j+counter] == '1':
                    mark = mark and True
                else :
                    mark = mark and False

            for y in range(j, j + counter +1):
                if matrix[i+counter][y] == '1':
                    mark = mark and True
                else :
                    mark = mark and False 
            if mark :
                maxS = (1 + counter) ** 2
                counter += 1
            else :
                break                        
        return maxS


